  <script src="./vasturiano.github.io_files/timelines-chart"></script><style type="text/css">.timelines-chart {

    fill: "none";

    stroke: #808080;
    stroke-opacity: 0.2;
  }

    stroke: none;
  }

  }

  .timelines-chart .legend {
    font-family: Sans-Serif;
  }

      fill: #666;
    }

  .timelines-chart .reset-zoom-btn {
    font-family: sans-serif;
    fill: blue;
    opacity: .6;
    cursor: pointer;
  }

.brusher .grid-background {
    fill: lightgrey;
  }

.brusher .axis path {
    display: none;
  }

.brusher .tick text {
    text-anchor: middle;
  }

.brusher .grid line, .brusher .grid path {
      stroke: #fff;
    }

.chart-zoom-selection, .brusher .brush .selection {
  stroke: blue;
  stroke-opacity: 0.6;
  fill: blue;
  fill-opacity: 0.3;
  shape-rendering: crispEdges;
}

.chart-tooltip {
  color: #eee;

  border-radius: 3px;

}

    font-size: 14px;
  }

  }
